export default function updateStudentGradeByCity(getListStudents, city, newGrades) {
	const filterd_std = getListStudents.filter((std) => std.location === city)
	return filterd_std.map((std) => {
		const find_gd = newGrades.find((grad) => std.id === grad.studentId)
		return {
			...std,
			grade: find_gd ? find_gd.grade: 'N/A'
		}
	})	
}

